"""## Step 3: Calculate Financial Ratios

Formulas used:
"""

# Cash/Total Assets
data["Cash_TA"] = data["Cash"] / data["TA"]

# Cash/Current_Liabilities
data["Cash_CL"] = data["Cash"] / data["CL"]

# Cash/Interest Expense
data["Cash_IE"] = data["Cash"] / data["Interest"]

# Quick Ratio (download inventory??)
data["Quick_Ratio"] = (data["CA"] - data["Inventories"]) / data["CL"]

# Long_Term_Debt/Total Assets
data["LTD_TA"] = data["Long_Term_Debt"] / data["TA"]

# EBIT/Interest Expense 
data["Interest_Coverage_Ratio"] = data["EBIT"] / data["Interest"]

# Fixed Assets/Total_Assets 
data["FA_TA"] = data["PPE"] / data["TA"]

# Net Sales/Employees 
data["Sales_Per_Employee"] = data["Sales"] / data["Employees"]

# Asset Management Ratios
data["Inventory_Turnover"] = data["COGS"]/data["Inventories"]
# data["Days_Sales_Outstanding"] = data["AR"]/(data["Sales"]/365)
data["TA_Turnover"] = data["Sales"]/data["TA"]

# Debt Management Ratio
data["Debt_Ratio"] = data["TL"]/data["TA"]

# Calculate Market Value Ratio
data["Market_To_Book_Ratio"] = data["Market_Value"] / data["BVPS"]
data["PE_Ratio"] = data["Price_Close"]/(data["NI"] / data["CSO"])
data["Dividend_Yield"] = (data["Div"]/data["CSO"]) / data["Price_Close"]

#Calculate Leverage Ratio
data["Leverage_Ratio"] = (data["Long_Term_Debt"] + data["CL_Debt"])/data["SE"]

#Dupont Analysis
data["ROA"] = data["NI"]/data["TA"]
data["ROE"] = data["NI"]/(data["CSO"]*data["Price_Close"])
data["ROI"] = data["NI"]/data["Invested_Capital"]
data["ATR"] = data["Sales"]/data["TA"]  
data["PMR"] = data["NI"]/data["Sales"]
data["Gross_Profit_Margin_Ratio"] = data["GP"]/data["Sales"]

##Convert merged data to excel for Tableau visualizations
